    private PipeParser Parser { get; } = new ();

    private LegacyPipeParser LegacyParser { get; } = new ();

    [Benchmark]
    public void ParseEr7WithLargeEmbeddedFile()
    {
        var oru = (ORU_R01)this.Parser.Parse(Er7WithLargeEmbeddedFile);

        ValidateObxRepetitionsAndObx5DataTypes(oru);
    }

    [Benchmark]
    public void LegacyParseEr7WithLargeEmbeddedFile()
    {
        var oru = (ORU_R01)this.LegacyParser.Parse(Er7WithLargeEmbeddedFile);

        ValidateObxRepetitionsAndObx5DataTypes(oru);
    }

    private static void ValidateObxRepetitionsAndObx5DataTypes(ORU_R01 oru)
    {
        var expectedObservationCount = 20;
        var parsedObservations = oru.GetPATIENT_RESULT(0).GetORDER_OBSERVATION(0).OBSERVATIONRepetitionsUsed;

        Debug.Assert(
            parsedObservations == expectedObservationCount,
            $"Expected 3 OBX repetitions used for this segment, found {parsedObservations}");

        foreach (var obs in oru.GetPATIENT_RESULT(0).GetORDER_OBSERVATION(0).GetOBSERVATION().OBX
                     .GetObservationValue())
        {
            Debug.Assert(obs.Data is ED, "Expected ED data type for OBX-5");
        }
    }
}